#Not Excepted because of Time Limit Exceeded
class Solution(object):
    def longestPalindrome(self, s):
        """
        :type s: str
        :rtype: strfo
        """
        l = len(s)
        lmax=0
        for i in range(1,l+1):
            for j in range(l-i+1):
                    if s[j: j + i]==s[j:j+i][::-1]:
                        if lmax<len(s[j: j + i]):
                            lmax=len(s[j: j + i])
                            smax=s[j: j + i]

        return smax
